import React, { useState,useEffect } from "react";
import myData from "../data.json";




const Idahodata = () => {
    const productlist = myData.IdahoproList
    console.log(productlist)
    productlist.map(dataIn => {
        return (
          <div key={dataIn.name}>
            {dataIn.name}
            <ul>
              {dataIn.yearlyvariations.map(variation => (
                <li key={variation.id}>{variation.title}</li>
              ))}
            </ul>
            {dataIn.position}
          </div>
        );
      });
   
};
export default Idahodata;
